css:
@-moz-document domain(wiki.garrysmod.com) {
.skin-garrysmod {
	background-color: #222222;
    background-image: none;
}


.examples_number {
    color: #4096EE!important;
}

.mw-content-ltr {
    color: #cccccc!important;  
}

.mw-content-ltr p {
 	color: #cccccc!important;   
}

.mw-content-ltr pre {
    background-color: #333333!important;	      
}

.argument {
 	color: #cccccc!important;   
}

.function_line {
 	background-color: #333333!important;
    color: #cccccc!important;
}

.mw-headline {
 	color: #4096EE!important;
    text-shadow: none!important;
}

.mw-headline a {
    color: #4096EE!important;
    text-shadow: none!important;
}

#mw-pages h2 {
    color: #4096EE!important;
    text-shadow: none!important; 
}

#mw-normal-catlinks {
 	background-color: #333333!important;   
}

#mw-normal-catlinks a {
